JsExternal represents an external value. From the Node API documentation: This is used to pass external data through JavaScript
code, so it can be retrieved later by native code A JsExternal can be created with either a Box , Rc or an Arc . fn return_external() -> Box<usize> { Box::new(10) // This is converted to a JsExternal
}
fn call_with_external(fun: JsFunction) -> JsResult<()> { fun.call(("hey", Arc::new(10)))?;
} In brief, everywhere a ToJs trait is expected, if you pass a Box , Rc or Arc , it is converted to a JsExternal . They are different ways to retrieve the external value. First, the tedious way: JsExternal has three methods take_box , get_rc and get_arc . // Let's consider that the external value is a Box<String>
// JsExternal::take_box returns a JsResult<Option<Box<T>>>
fn external(external: JsExternal) { let value = external.take_box::<String>()?; // value is Some(Box<String>) let value = external.take_box::<String>()?; // The box has been taken, it's not possible to retrieve it. // value is None external.get_rc::<String>()?; // This panics, the external value is not a Rc external.take_box::<usize>()?; // This panics, the external value is not a usize
} // Let's consider that the external value is a Rc<usize>
// JsExternal::get_rc returns a JsResult<Rc<T>>
fn external(external: JsExternal) { let value = external.get_rc::<usize>()?; // value is a Rc<usize> let value = external.get_rc::<usize>()?; // value is another Rc<usize> external.take_box::<usize>()?; // panic external.get_rc::<String>()?; // panic
