You can create JS classes from Rust. Every Rust types that implement the trait JsClass can be use as a JS class. The trait is defined as follow: pub trait JsClass : Sized + 'static { // The name of this class in JS const CLASSNAME: &'static str; // The type that the constructor of this class // will receive as arguments. // Example: (String, Arc<usize>) type ArgsConstructor: FromArguments; // Static function called to create the class fn constructor(args: Self::ArgsConstructor) -> Result<Self> ; // Optional function to define default properties // of this class fn default_properties(builder: ClassBuilder<Self>) -> ClassBuilder<Self> { builder }
} An example of implemention to JsClass : struct MyClass { state: Arc<State>, n: i64
} impl MyClass { fn inc(&mut self) { self.n += 1; } // This function is used to set/get Self::n fn accessor_n(&mut self, new_n: Option<i64>) -> i64 { if let Some(new_n) = new_n { self.n = new_n; } self.n } fn sample(&mut self, args: (String, MyCustomType)) {}
} impl JsClass for MyClass { const CLASSNAME: &'static str = "MyRustClass"; type ArgsConstructor = (Arc<State>, i64); fn constructor((state, n): Self::ArgsConstructor) -> Result<Self> { Ok(MyClass { state, n }) } fn default_properties(builder: ClassBuilder<Self>) -> ClassBuilder<Self> { builder.with_method("increment", MyClass::inc) .with_method("sample", MyClass::sample) .with_accessor("n", MyClass::accessor_n) } } There are 2 ways to make a new instance of this class:

